:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, Edward Marsh and DAVIS, Jane
  JWILLIAMS, Thomas Sydney and WILLIAMS, Agnes Lydia
  JWILLIAMS, Oswald Temple (Gos) and WOOD, Violet Lethridge
  JWILLIAMS, Margot Temple and FRASER, Alec Mac
  IFRASER, Carol and NELSON , Paul Sunderland
  01> FRASER, Carolm on 09.04.1974 to NELSON, Paul Sunderland
  b 18.07.1950
  b 02.12.1947
  Carol b. at Gisborne and m, at Te Karaka. Paul, s/o William Oswald (Punch)
  Nelson and Phoebe Mary Graham. He is a great-grandson of William Nelson
  from his first marriage to Sarah Bicknell. Address: "Airhill", RD 1,
  Hastings.
  Carol was educated at Woodford House. Paul is a farmer on "Airhill" near
  Hastings. He and Carol train and race horses and their successes have
  included Storm which won the 1987 Wellington Steeplechase, Chibuku, Thesaurus and currently
  Chibuli.
  Airhill
  "Airhill" is situated on Highway 50 about 40 km south west of Hastings, between Maraekakaho and
  Tikokino. Originally part of "Maraekakaho" station, a 1,500 acre block of regrowth scrub was
  bought by Oswald Nelson about 1925. It was taken over by his son, Punch Nelson after WW2 and from
  1970 to 1981 it was farmed in partnership by Paul Sunderland Nelson and his brother, Sam. The
  property was then divided into two blocks, Paul taking "Airhill" of 286 hectares where he now runs
  sheep and cattle with a small thoroughbred stud.
  01> NELSON, Angus Mac
  b 20.12.1977
  Angus b, at Hastings. He was educated at Maraekakaho and Lindisfarne where he
  was sports prefect, head of Cuthbert House, captain of the 1st cricket XI and a
  member of the 1st rugby XV. He is now completing a BCom(Ag) at Lincoln
  University.
  02> NELSON, Briar
  b 03.01.1980 d 12.10.1980
  Briar b. at and d. at Hastings.
  02> FRASER, Fern Joy m on 09.04.1983 to MOORE, Alister. George
  b 08.03.1954
  b 16.12.1957
  Fern b, at Gisborne and m. at Te Karaka. George, s/o George Michael Moore
  and Elisabeth Ann Warren, b. at Masterton. Address: "Beaumont", RD 12,
  Masterton.
  Fern was educated at Woodford House and George at Wanganui Collegiate
  School. They are farming on "Beaumont", a coastal hill country property.
  | Refer to "The Family of Thomas and Jane Mason of Taita" published by
  Evagean Publishing in 1994 for records of Alister's family.
  01> MOORE, Susanna Rose
  b 18.04.1985
  Susanna b. at Masterton.
